	private void search() {
		String wd = ((EditText) findViewById(R.id.editText1)).getText()
				.toString().trim();
		showList.clear();
		if (TextUtils.isEmpty(wd)) {
			showList.addAll(allList);
		} else {

			ArrayList<XFplayurl> tempList = new ArrayList<XFplayurl>();
			for (XFplayurl i : allList) {
				if (i.getName().toLowerCase().contains(wd.toLowerCase())) {
					tempList.add(i);
				}
			}
			if (tempList.size() > 0) {
				showList.addAll(tempList);
			}
		}
		myListViewAdapter.notifyDataSetChanged();
	}

	private HashMap<String, String> map = new HashMap<String, String>();

	private int index = 0;

	private void addlist(String string) {

		String str = AbBase64.decode(string, "gbk").replace('\n', '|');
		for (String all : str.split("\\|")) {
			String[] s = all.split(",");
			if (s.length == 2 && map.get(s[1]) == null) {
				map.put(s[1], s[0]);
				if (s[1].contains("#")) {
					int j = 1;
					for (String string2 : s[1].split("#")) {
						if (!AbStrUtil.isEmpty(string2)) {

							XFplayurl obj = new XFplayurl();
							obj.setName((index++) + "台 " + s[0].trim() + "(源"
									+ j++ + ")");
							obj.setUrl(string2.trim());
							allList.add(obj);
						}
					}
					continue;
				}
				XFplayurl obj = new XFplayurl();
				obj.setName((index++) + "台 " + s[0].trim());
				obj.setUrl(s[1].trim());
				allList.add(obj);
			}
		}
	}

